import logo from './logo.svg';



import './App.css';
import 'animate.css';
export default App;



function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <img src='./r1.svg' className="r1" alt="r1" />

        <p>
          <code>Bienvenue</code>
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React 
        </a>
      </header>
    </div>
  );
}
